import React from 'react';
import classes from "./Navigation.module.css";

const Navigation = () => {
    return (
        <div className={classes.navig}>
            <img className={classes.logo} src="img/logo.svg" alt=""/>
            <nav>
                <a href="#" className={classes.item}>Оставить отзыв</a>
                <a href="#" className={classes.item}>Найти работу</a>
                <a href="#" className={classes.item}>Акции</a>
                <a href="#" className={classes.item}>Справка</a>
                <a href="#" className={classes.item}>Русский</a>
                <a href="#" className={classes.item}><img className={classes.account} src="img/account.svg" alt=""/>Войти</a>
            </nav>
        </div>

    );
}

export default Navigation;
